
// [START declaration]
syntax = "proto3";
package choice;


// [START csharp_declaration]
option csharp_namespace = "Google.Protobuf.Examples.AddressBook";
// [END csharp_declaration]



// [START messages]
message Choice {
  string WhoWin = 1;
  string hash=3;
  int64 choice = 2;  
  string status = 4;
}
